INSERT INTO `contents` VALUES (1,'Red de Sucursales Honda Motos',NULL,'branch-offices','2018-08-03 14:41:52','2018-12-17 16:15:40'),(2,'Postventa','<p><strong><span style=\"font-size: 1.7rem;\">Postventa</span></strong></p><p><span style=\"font-size: 1.5rem;\"><strong style=\"\">La mejor Red de Servicios y Repuestos</strong><br></span></p><p><strong><span style=\"font-size: 1.5rem;\">Un mundo entero para tu Honda:</span></strong></p><p>- Profesionales de Primer Nivel</p><p>- Repuestos originales para alargar la vida util de tu Motocicleta</p><p>- Amplia Red de Servicios para tu comodidad</p><p><strong><br></strong></p><p><strong><span style=\"font-size: 1.7rem;\">Garantía de Fábrica</span></strong></p><p><strong>Hasta 400 cc:</strong> 6 meses ó 10.000 kilómetros (lo que primero se cumpla)</p><p><strong>Superior a 400 cc:</strong> 12 meses&nbsp;</p><p>Para conocer más sobre las condiciones de Garantía, ingresá&nbsp;<a href=\"https://drive.google.com/open?id=1ojpcvSVXY96gAC47Y5r_F-KU6s7bT1f8\" style=\"background-color: rgb(255, 255, 255);\"><strong>aquí</strong></a><span style=\"font-size: 1.7rem;\"><br></span><span style=\"font-size: 0.9rem;\"><br></span></p><p><strong><span style=\"font-size: 1.7rem;\"><a href=\"https://bit.ly/recallhondamotospy\">Campañas de Servicio</a></span></strong></p><p><span id=\"id_read_off_comentario\" class=\"css_read_off_comentario\">Las Campañas de Servicio (recalls) corresponden a un concepto de Mantenimiento Predictivo donde el fabricante de un producto advierte que se puede presentar una falla en algún elemento, lo cual puede afectar el funcionamiento o incluso poner en riesgo a los ocupantes de la motocicleta o peatones.&nbsp;</span></p><p><span class=\"css_read_off_comentario\">Cuando se determina que una pieza puede ocasionar un desperfecto, los fabricantes hacen un llamado a los propietarios de los vehículos posiblemente afectados para efectuar las acciones correspondientes.&nbsp;</span></p><p><span class=\"css_read_off_comentario\">Para determinar si su motocicleta actualmente se encuentra incluida en una campaña de servicio activa, favor <a href=\"https://bit.ly/recallhondamotospy\">ingrese aquí</a> el número de chasis (17 dígitos), que lo encuentra en la cedula verde del vehículo.</span><br></p><p><span class=\"css_read_off_comentario\">En caso que la campaña de servicio de su unidad no haya sido atendida, los contactos por zona son:</span></p><p><a href=\"wa.me/595215197165\"><strong></strong></a></p><p xmlns=\"http://www.w3.org/1999/xhtml\"><a href=\"wa.me/595215197165\"><strong><span class=\"css_read_off_comentario\"></span></strong></a></p><p xmlns=\"http://www.w3.org/1999/xhtml\"><a href=\"https://api.whatsapp.com/send/?phone=595215197165&amp;text&amp;app_absent=0\">Asunción</a></p><p></p><p><span class=\"css_read_off_comentario\"><strong></strong></span></p><p><span class=\"css_read_off_comentario\"><strong><a href=\"https://api.whatsapp.com/send/?phone=595215197157&amp;text&amp;app_absent=0\">Interior</a></strong></span></p><p><span class=\"css_read_off_comentario\"><span style=\"font-size: 1.7rem;\"><strong><br></strong></span></span></p><p><span class=\"css_read_off_comentario\"><span style=\"font-size: 1.7rem;\"><strong>Agendamiento</strong></span></span></p><p>Para agendar tu turno en Asunción ingresá <a href=\"https://www.bit.ly/agendamientohondamotos\"><strong>aquí</strong></a></p>','service','2018-08-03 14:42:34','2022-03-10 15:09:10'),(3,'La empresa','<h2>Filosofía</h2> <p>Nuestra filosofía se basa en una creencia fundamental: hacer felices a nuestros clientes y mejorar sus vidas. Siempre nos esforzamos para desarrollar nuestras ideas y cumplir nuestras ambiciones, compartiendo el placer y la emoción de lograr esto con todo el mundo.</p><br><p>Nuestros fundadores, Soichiro Honda y Takeo Fujisawa, inculcaron su sueño en la filosofía de Honda. Se basa en dos aspectos fundamentales: el respeto a la persona y algo que nosotros denominamos \"Los tres placeres\". Hoy en día, todos nuestros empleados siguen teniendo presente esta filosofía y se aplica en todas nuestras actividades corporativas.</p><br><p>Pero la visión de Honda no es solo teoría. Nuestros empleados saben que la empresa confía en ellos y les anima a enfrentarse a los desafíos sin temer al fracaso. En Honda se respeta a todo el mundo. Soichiro no lo habría hecho de otra manera.</p><p>LOS TRES PLACERES</p><p>Comprar, vender, crear.</p><p>El placer de comprar</p><p>Queremos que nuestros clientes tengan la sensación de haber elegido sabiamente y que puedan disfrutar durante años del fiel servicio prestado por Honda.</p><br><p>El placer de vender</p><p>Nuestra gama debe servir como motivación para nuestros concesionarios. Un concesionario no puede vender fácilmente un producto que no inspira confianza.</p><br><p>El placer de crear</p><p>Si nuestros clientes y concesionarios están satisfechos, nuestros equipos de desarrollo pueden estar orgullosos de su trabajo, un trabajo bien hecho.</p><p><br></p><p class=\"textOneColTwoImgMod section\" style=\"font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 10px; background-color: rgb(244, 243, 248);\"><p class=\"module pd pdTxtSingColMltiImg2 \" style=\"clear: both; margin: 96px 0px;\"><br></p></p>','about-us','2018-08-03 14:44:57','2018-12-03 22:53:12'),(4,'Contactanos','<p>Tel.: 021 519 7000</p> <p>Dir.: EUSEBIO AYALA KM4,5</p> <p>ASUNCIÓN-PARAGUAY</p><p><a href=\"http://honda.diesa.com.py/cms/contents/4/telemarketing@diesa.com.py\" style=\"background-color: rgb(255, 255, 255); color: rgb(114, 175, 210); outline: none;\">telemarketing@diesa.com.py</a></p>','contact-us','2018-08-03 14:46:06','2020-07-17 22:48:16');
