><span style=\\\"font-size: 0.9rem;\\\">Equipado con el nuevo faro LED para que pueda explorar\\nmás, ya sea para viajes en la ciudad o afuera de ella. Con sus audaces gráficos\\ndeportivos, te harán lucir como toda<span style=\\\"vertical-align: baseline;\\\">\\nuna personalidad </span>alfa.</span></span></p>\",\"text_align\":\"right\"}','products','text+image','left'),(17,18,'uploads/products/18_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14','{\"color\":\"white\",\"text\":\"<p style=\\\"color: rgb(64, 64, 64); font-family: \\\" roboto=\\\"\\\" condensed\\\",=\\\"\\\" \\\"helvetica=\\\"\\\" neue\\\",=\\\"\\\" helvetica,=\\\"\\\" arial,=\\\"\\\" sans-serif;=\\\"\\\" font-size:=\\\"\\\" 16px;\\\"=\\\"\\\">El aumento del desplazamiento, la mayor potencia y la mejor estabilidad, mejoran la naturaleza inspiradora de la l\\u00ednea recreativa CRF. Adem\\u00e1s de eso, la CRF250F trae un nuevo motor de cuatro v\\u00e1lvulas de 250 cc con inyecci\\u00f3n electr\\u00f3nica de combustible Keihin para aumentar la potencia.<\\/p><p style=\\\"color: rgb(64, 64, 64); font-family: \\\" roboto=\\\"\\\" condensed\\\",=\\\"\\\" \\\"helvetica=\\\"\\\" neue\\\",=\\\"\\\" helvetica,=\\\"\\\" arial,=\\\"\\\" sans-serif;=\\\"\\\" font-size:=\\\"\\\" 16px;\\\"=\\\"\\\">Tambi\\u00e9n, trae m\\u00e1s torque y una entrega de potencia lineal, que da como resultado que los nuevos pilotos y los todoterreno avanzados pueden utilizar el torque fuerte en las secciones t\\u00e9cnicas. Del mismo modo, la potencia suave de gama baja se integra perfectamente en un rango medio y superior m\\u00e1s fuerte. Tambi\\u00e9n, la centralizaci\\u00f3n masiva de la l\\u00ednea de rendimiento CRF se traslada a este modelo, el silenciador colocado m\\u00e1s cerca del centro de masa.<\\/p>\",\"text_align\":\"left\"}','products','text+image','left'),(18,19,'uploads/product_descriptions/18.','2019-04-29 17:09:14','2020-05-27 18:37:11','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margi