\",\"text_align\":\"right\"}','products','text+image','left'),(24,25,NULL,'2019-04-29 17:09:14','2019-04-29 17:09:14','{\"color\":\"white\",\"text\":\"<p style=\\\"color: rgb(64, 64, 64); font-family: \\\" roboto=\\\"\\\" condensed\\\",=\\\"\\\" \\\"helvetica=\\\"\\\" neue\\\",=\\\"\\\" helvetica,=\\\"\\\" arial,=\\\"\\\" sans-serif;=\\\"\\\" font-size:=\\\"\\\" 16px;\\\"=\\\"\\\">El aumento del desplazamiento, la mayor potencia y la mejor estabilidad, mejoran la naturaleza inspiradora de la l\\u00ednea recreativa CRF. Adem\\u00e1s de eso, la CRF250F trae un nuevo motor de cuatro v\\u00e1lvulas de 250 cc con inyecci\\u00f3n electr\\u00f3nica de combustible Keihin para aumentar la potencia.<\\/p><p style=\\\"color: rgb(64, 64, 64); font-family: \\\" roboto=\\\"\\\" condensed\\\",=\\\"\\\" \\\"helvetica=\\\"\\\" neue\\\",=\\\"\\\" helvetica,=\\\"\\\" arial,=\\\"\\\" sans-serif;=\\\"\\\" font-size:=\\\"\\\" 16px;\\\"=\\\"\\\">Tambi\\u00e9n, trae m\\u00e1s torque y una entrega de potencia lineal, que da como resultado que los nuevos pilotos y los todoterreno avanzados pueden utilizar el torque fuerte en las secciones t\\u00e9cnicas. Del mismo modo, la potencia suave de gama baja se integra perfectamente en un rango medio y superior m\\u00e1s fuerte. Tambi\\u00e9n, la centralizaci\\u00f3n masiva de la l\\u00ednea de rendimiento CRF se traslada a este modelo, el silenciador colocado m\\u00e1s cerca del centro de masa.<\\/p>\",\"text_align\":\"left\"}','products','text+image','left'),(25,26,'uploads/product_descriptions/25_1591020843_4193.jpeg','2019-04-29 17:09:14','2020-12-03 17:43:05','{\"color\":\"gray\",\"text\":\"<p style=\\\"text-align: right;\\\" roboto=\\\"\\\" condensed\\\",=\\\"\\\" \\\"helvetica=\\\"\\\" neue\\\",=\\\"\\\" helvetica,=\\\"\\\" arial,=\\\"\\\" sans-serif;=\\\"\\\" font-size:=\\\"\\\" 16px;\\\"=\\\"\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.1rem;\\\">¿ Por qué?</span></strong></p><p style=\\\"text-align: right; \\\" roboto=\\\"\\\" condensed\\\",=\\\"\\\" \\\"helvetica=\\\"\\\" neue\\\",=\\\"\\\" helvetica,=\\\"\\\" arial,=\\\"\\\" sans-serif;=\\\"\\\" font-size:=\\\"\\\" 16px;\\\"=\\\"\\\"><span style=\\\"font-size: 1rem;\\\">La CRF250R, ha evolucionado hasta convertirse en una plataforma de la que tanto los aficionados amateur de la MX, como los profesionales, pueden sacar el máximo provecho.</span></p><p><br></p><p style=\\\"color: rgb(64, 64, 64); font-family: \\\" roboto=\\\"\\\" condensed\\\",=\\\"\\\" \\\"helvetica=\\\"\\\" neue\\\",=\\\"\\\" helvetica,=\\\"\\\" arial,=\\\"\\\" sans-serif;=\\\"\\\" font-size:=\\\"\\\" 16px;\\\"=\\\"\\\"><br></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(44,36,'uploads/product_descriptions/44_1613499691_8667.jpeg','2020-03-28 02:14:56','2021-02-16 21:21:31','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 1.2rem;\\\"><span style=\\\"color: black; font-weight: bold;\\\">¿Por qué</span><span style=\\\"color: black; font-weight: bold; vertical-align: baseline;\\\">?</span></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in; word-break: normal;\\\"><u><span style=\\\"color: black; font-weight: bold;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Manejo:</span></span></span></u></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in; word-break: normal;\\\"><span style=\\\"color: black; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">El centro de gravedad alto y su aro delantero de 21 pulgadas, hacen de este modelo&nbsp;un ágil todoterreno,&nbsp; y donde su hábitat principal, es el Off-road. Con una potencia que sale desde abajo, lo hace especial para&nbsp; explorar y llegar a cada rincón del mundo.</span></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in; word-break: normal;\\\"><u><span style=\\\"color: black; font-weight: bold; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Inspiración:</span></span></span></u></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in; word-break: normal;\\\"><span style=\\\"color: black; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Inspirada en la legendaria Africa Twin penta campeona del Paris-Dakar, con la fusión de&nbsp; las tecnologías de las CBR`s y CRF`s hacen de este modelo única y especial; ligera para el off-road y potente para el asfalto.&nbsp;</span></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in; word-break: normal;\\\"><u><span style=\\\"color: black; font-weight: bold; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Extra:</span></span></span></u></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in; word-break: normal;\\\"><font color=\\\"#000000\\\" face=\\\"Nexa, Helvetica Neue, Helvetica, Arial, sans-serif\\\" size=\\\"1\\\">Incorpora un nuevo sistema de ABS en curva, el sistema Wheelie &amp; Rear Lift Control y seis modos de conducción. Los cuatro primeros (Tour, Urban, Gravel y Off-road) ya vienen pre-configurados actuando específicamente sobre aspectos como la potencia, el freno motor y el ABS para que la motocicleta se comporte de forma concreta ante distintos escenarios de conducción. Además, la nueva generación trae dos modos más de conducción llamados User, que son completamente configurables a gusto del conductor, lo que les permite acceder a ellos de forma más rápida y cómoda.</font><br></p>\",\"text_align\":\"right\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(26,27,'uploads/product_descriptions/26_1591021434_7803.jpeg','2019-04-29 17:09:14','2020-11-26 21:58:30','{\"color\":\"red\",\"text\":\"<p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">¿ Para<span style=\\\"vertical-align: baseline;\\\">\\nqué?</span></span></strong></span></p><p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Uso:\\nDiversión<span style=\\\"vertical-align: baseline;\\\">, competición.</span></span></span></p><p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Suelo: Todo terreno</span></span><br></p><p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-weight: 700;\\\"><span style=\\\"font-size: 1.2rem;\\\">Características Principales:</span></span></span></p><p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; 