e=\\\"font-weight: 700;\\\"><span style=\\\"font-size: 1.2rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\">Características Principales:</span></span></span></p><p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><span style=\\\"color: black; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Una moto que utiliza como base la CRF250R, con especificaciones para Enduro.</span></span></p><p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Aro trasero de 18 pulgadas, con llantas negras y nueva pinza de freno delantero.&nbsp;</span></span></p><p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Suspensiones delanteras más suaves adaptadas al enduro.&nbsp;</span></span></p><p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Motor con Launch Control&nbsp; HRC de 3 niveles.</span></span></p><p style=\\\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\\ntext-indent:0in;direction:ltr;unicode-bidi:embed;vertical-align:baseline\\\"><span style=\\\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\\\"></span></p>\",\"text_align\":\"left\"}','products','text+image','left'),(39,0,'uploads/product_descriptions/39_1615387922_0195.jpeg','2020-03-27 00:02:45','2021-03-11 18:00:26','{\"video\":\"https://www.youtube.com/watch?v=4HGnJmHZbFM\"}','home','video','left'),(42,0,'uploads/product_descriptions/42_1590771408_8673.jpeg','2020-03-27 00:59:32','2020-05-29 21:56:48','{\"text\":\"<p style=\\\"text-align: left;\\\"><strong><span style=\\\"font-size: 1.2rem;\\\">DESCUBRÍ LO MÁS NUEVO DE HONDA</span></strong><br></p>\",\"text_align\":\"right\"}','home','text-over-image','left'),(43,0,NULL,'2020-03-27 00:59:32','2021-03-11 17:15:13','{\"video\":\"https://www.youtube.com/watch?v=COsoQAEAmT4\"}','home','video','left'),(45,36,'uploads/product_descriptions/45_1613499691_869.jpeg','2020-03-28 02:14:57','2021-03-11 17:18:05','{\"color\":\"gray\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Descripción&nbsp;</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">La nueva Africa Twin es la verdadera estrella dentro del catálogo de las motos trail de la marca N°1 del mundo. Una digna heredera de la mítica montura de los años 80 y 90, con una tecnología y electrónica capaz de todo. Esta nueva generación se ha renovado por completo y vuelve a Paraguay en tres versiones:</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">1) Off Road</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">2) Adventure</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">3) Adventure con suspensión electrónica&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Ahora, la moto de Honda es entre cuatro y cinco kilos más liviana (según la versión) y tiene más potencia (1.084 CC) que entrega el motor bicilíndrico en paralelo, de cuatro tiempos, ocho válvulas, OHC y refrigerado por líquido. Todas estas características mejoran las prestaciones de la moto, y al mismo tiempo, cumple con los límites de emisiones contaminantes Euro 5. En cuanto a tecnología, está equipada con una nueva Unidad de Medición Inercial (IMU) de seis ejes que es la encargada de controlar y gestionar la electrónica de estos modelos: incluye un acelerador electrónico (Ride by Wire), Control de Par Seleccionable Honda (HSTC), aviso de frenada de emergencia y control de velocidad de crucero.&nbsp;</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Unas de las renovaciones más relevantes es la nueva pantalla táctil TFT Multifunción de 6,5 pulgadas en color, que ofrece una selección intuitiva de modos de conducción y un fácil control de la navegación. Incorpora conectividad Apple CarPlay y Bluetooth, permitiendo recibir instrucciones de navegación, realizar llamadas, recibir mensajes y escuchar música mediante las aplicaciones del dispositivo</span></span><span style=\\\"font-size: 0.9rem;\\\"> móvil.</span><br></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(47,30,'uploads/product_descriptions/47.','2020-05-07 19:10:06','2021-04-15 18:15:48','{\"color\":\"gray\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 1.2rem;\\\"><span style=\\\"color: black; font-weight: bold;\\\">¿ Por qué</span><span style=\\\"color: black; font-weight: bold; vertical-align: baseline;\\\">?</span></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><u><span style=\\\"color: black; font-weight: bold; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Manejo:&nbsp;</span></span></u></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><span style=\\\"color: black; vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">La relación de marcha larga, el peso ligero, y la tecnología del motor, hacen que el andar en la moto sea suave, ágil y económico.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><u><span style=\\\"color: black; font-weight: bold; vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Inspiración:</span></span></u></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><span style=\\\"color: black; vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Inspirada para las personas que utilizan la motocicleta todos los días, ya sea como movilidad o trabajo, siendo de esta manera, el modelo más económico del mercado.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><u><span style=\\\"color: black; font-weight: bold; vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Extra:</span></span></u></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><span style=\\\"color: black; vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Seguridad y durabilidad para toda la vida.</span></span></p>\",\"text_align\":\"right\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(48,30,'uploads/product_descriptions/48.','2020-05-07 19:10:07','2021-04-15 18:15:48','{\"color\":\"red\",\"text\":\"<p style=\\\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><strong style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></p>\\n\\n<p style=\\\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><span style=\\\"color: black; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">La\\nnueva Honda CB1 125, heredera de un estilo urbano y diseño clásico, posee un\\nconfiable y resistente motor OHC de 4 tiempos y 125 cm3 refrigerado por aire,\\nque le otorga gran potencia y versatilidad. Cuenta con una caja de 4 velocidades que le\\naporta mayor agilidad. Una moto hecha para disfrutar las ventajas de moverse\\npor la ciudad de manera ágil y económica. </span></span></p>\\n\\n\\n\\n<p style=\\\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><span style=\\\"color: black; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Su\\nsuspensión delantera telescópica y trasera de doble amortiguación, ofrecen una\\nconducción confortable en las irregularidades del camino, y la hacen ideal para\\ntrabajar o salir a disfrutarla todos los días. Además, cuenta con detalles\\ncomo: chasis reforzado, faros de 35W para una visión nocturna más segura,\\narranque a patada y un tanque de combustible de 10 lts. que le otorgan un\\nestilo único. Se comercializa en 4 colores: negro, plata, rojo y azul.</span></span></p><p style=\\\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\"><br></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(49,2,'uploads/product_descriptions/49_1614257433_8836.jpeg','2020-05-07 23:06:50','2021-02-25 15:50:33','{\"color\":\"gray\",\"text\":\"<p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">¿Por qué?</span></strong><br></span></p><p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Manejo:</strong><br>El\\ncentro de gravedad alto y su aro delantero de 21 pulgadas, hacen de este\\nmodelo&nbsp;un ágil todoterreno, y donde su\\nhábitat principal, es el Off-road. Con una potencia que sale desde abajo, lo hace especial para&nbsp; explorar y llegar a cada\\nrincón del mundo.</span></span></p><p><strong style=\\\"\\\"><span style=\\\"font-size: 0.9rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\">Inspiración:</span></strong></p><p><span style=\\\"font-size: 0.9rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\">Inspirada\\nen la legendaria Africa Twin penta campeona del Paris-Dakar, con la fusión\\nde&nbsp; las tecnologías de las CBR`s y CRF`s\\nhacen de este modelo única y especial.&nbsp; Ligera para el off-road y potente para el\\nasfalto.&nbsp;</span></p>\\n\\n\\n\\n<p><strong><span style=\\\"font-size: 0.9rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\">Extra:</span></strong></p><p><span style=\\\"font-size: 0.9rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\">En\\nsu versión DCT posee una caja intuitiva que permite al piloto concentrarse\\nexclusivamente en el manejo. Así como también una versión ADV especial tricolor\\npor el 30º aniversario del modelo.&nbsp;</span></p>\",\"text_align\":\"right\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(50,2,'uploads/product_descriptions/50_1614257433_8858.jpeg','2020-05-07 23:06:51','2021-06-01 19:06:21','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1rem;\\\">Descripción:&nbsp;</span></strong></span></p><p class=\\\"MsoNormal\\\"><span lang=\\\"ES-PY\\\" style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Es la versión más equipada desarrollada\\npara los más aventureros. Toma de base la versión estándar, por lo que se\\nbeneficia de todas las mejoras y novedades de la otra, pero añade los elementos\\nnecesarios para satisfacer las necesidades que surgen en las largas travesías.\\nLa diferencia más destacada es el montaje de un depósito de mayor capacidad\\n-24,8 litros- con el que se obtiene una autonomía superior a los 500 km.<o:p></o:p></span></span></p><p class=\\\"MsoNormal\\\"><span lang=\\\"ES-PY\\\" style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Otro cambio visible es el parabrisas de\\nmayor tamaño, ajustable en altura en cinco posiciones y que garantiza una mayor\\nprotección aerodinámica.<o:p></o:p></span></span></p><p class=\\\"MsoNormal\\\"><span lang=\\\"ES-PY\\\" style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">De serie, la Adventure Sports se beneficia\\nde deflectores laterales para el viento, protector del motor de mayor tamaño,\\nprotectores de aluminio, neumáticos sin cámara, cargador 12V y puños\\ncalefactables.<o:p></o:p></span></span></p><p class=\\\"MsoNormal\\\"><span lang=\\\"ES-PY\\\" style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Cuenta con tres modos <o:p></o:p></span></span></p><p class=\\\"MsoNormal\\\"><span lang=\\\"ES-PY\\\" style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">- Soft<o:p></o:p></span></span></p><p class=\\\"MsoNormal\\\"><span lang=\\\"ES-PY\\\" style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">- Mid <o:p></o:p></span></span></p><p class=\\\"MsoNormal\\\"><span lang=\\\"ES-PY\\\" style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">- Hard<o:p></o:p></span></span></p><p class=\\\"MsoNormal\\\"><span lang=\\\"ES-PY\\\" style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">- más uno Off-Road<o:p></o:p></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\\\">\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n</p><p class=\\\"MsoNormal\\\"><span lang=\\\"ES-PY\\\" style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Una mejora notable respecto a la Adventure\\nSports anterior es la altura del asiento, que pasa a ser igual a la de la\\nversión estándar, lo que supone 5 cm menos.<o:p></o:p></span></span></p><p><br></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(138,2,NULL,'2021-03-11 17:59:20','2021-03-11 17:59:20','{\"video\":\"https://www.youtube.com/watch?v=4HGnJmHZbFM\"}','products','video','left'),(58,32,'uploads/product_descriptions/58.','2020-05-12 21:19:18','2020-12-03 16:03:44','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-weight: 700;\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Es una excelente elección para quienes buscan emoción en todo momento. El doble amortiguador trasero proporciona un equilibrio perfecto entre estabilidad en rectas y respuesta en curvas. Y en lugares realmente estrechos.&nbsp;</span></span></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(59,32,NULL,'2020-05-12 21:19:19','2020-05-12 21:19:19','{\"video\":\"https://www.youtube.com/watch?v=ACHP6BnV_qg\"}','products','video','left'),(60,30,NULL,'2020-05-13 00:30:27','2020-05-13 00:30:27','{\"video\":\"https://www.youtube.com/watch?v=cSnWVXNsBQE\"}','products','video','left'),(61,14,'uploads/product_descriptions/61_1594666409_5306.jpeg','2020-05-13 17:31:39','2020-09-22 22:00:17','{\"color\":\"gray\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">¿ Por qué<span style=\\\"vertical-align: baseline;\\\">?</span></span></strong></span></p><p roboto=\\\"\\\" condensed\\\",=\\\"\\\" \\\"helvetica=\\\"\\\" neue\\\",=\\\"\\\" helvetica,=\\\"\\\" arial,=\\\"\\\" sans-serif;=\\\"\\\" font-size:=\\\"\\\" 16px;\\\"=\\\"\\\" style=\\\"\\\">\\n\\n</p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Es\\nuna motocicleta dirigida a usuarios que buscan vivir nuevas aventuras. Brinda\\ntoda la fuerza y potencia necesaria para lograr un rendimiento eficiente y que\\ncada motociclista pueda vivir nuevos desafíos dentro y fuera del asfalto.</span></span></p>\",\"text_align\":\"right\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(62,14,'uploads/product_descriptions/62_1594666409_5325.jpeg','2020-05-13 17:31:39','2020-09-22 22:00:17','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p roboto=\\\"\\\" condensed\\\",=\\\"\\\" \\\"helvetica=\\\"\\\" neue\\\",=\\\"\\\" helvetica,=\\\"\\\" arial,=\\\"\\\" sans-serif;=\\\"\\\" font-size:=\\\"\\\" 16px;\\\"=\\\"\\\" style=\\\"\\\">\\n\\n</p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Esta<span style=\\\"vertical-align: baseline;\\\"> </span>diseñada para los usuarios en busca\\naventuras nuevas todos los días. Su potencia permite lograr un rendimiento\\neficiente en cualquier tipo de camino.</span></span></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(64,33,'uploads/product_descriptions/64.','2020-05-13 23:12:58','2020-07-13 22:38:21','{\"color\":\"red\",\"text\":\"<p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></span></p><p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Lo que más llama la atención de este modelo es su imagen radical y agresiva; una deportiva con el carácter robusto. Tiene un estilo único que apunta a la deportividad como concepto y que invita a dominar las calles de la ciudad de un modo sencillo.</span></span></p><p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Su motor es un monocilíndrico de 160 cc, enfriado por aire que acelera de modo progresivo. A la hora de rebasar vehículos encuentra el punto ideal con un torque que resulta perfecto para la ciudad.</span></span></p><p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">El encendido es eléctrico, así como también tiene la posibilidad de hacer un arranque a través del pedal.</span></span></p><p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">En cuanto a las suspensiones, el comportamiento también es adecuado para una moto que desarrollará la mayor parte de su vida en ciudades con pavimentos irregulares y con constantes inconvenientes cotidianos. Por ello, se sienten firmes, tanto la horquilla telescópica delantera (de 117 mm de carrera), como el monoamortiguador trasero ajustable en resorte, que absorbe cualquier elemento del camino.</span></span></p><p><br></p><p><br></p>\",\"text_align\":\"left\"}','products','text+image','left'),(67,40,'uploads/product_descriptions/67.','2020-05-19 17:50:07','2020-07-13 22:56:58','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Es\\nperfecta para los usuarios que buscan&nbsp;\\nencontrar una moto de aspecto deportivo y tecnológico; ideal para recorrer el corazón de la ciudad y sus alrededores. Su iluminación es totalmente LED, tanto en los faros, piloto trasero, e intermitentes. Esta moto está creada para dejarse ver y, sobre todo, ser vista y destacar en todas partes.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><br></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><br></p>\",\"text_align\":\"left\"}','products','text+image','left'),(69,31,'uploads/product_descriptions/69.','2020-05-19 18:03:49','2020-05-27 18:34:59','{\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\