;\\\"><span style=\\\"font-size: 0.9rem;\\\">Suelo:&nbsp;Todo terreno</span></span><br></p><p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline;\\\"><span style=\\\"font-weight: 700;\\\"><span style=\\\"font-size: 1.2rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\">Características Principales:</span></span></span></p><p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Batería tipo libre de mantenimiento.</span></span></span></p><p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Ajustadores de cadena tipo caracol para un fácil mantenimiento.</span></span></span></p><p style=\\\"text-align: right; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">El asiento estilo motocross es bajo, cómodo y permite el movimiento completo del ciclista.</span></span></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(72,19,'uploads/product_descriptions/72.','2020-05-19 18:17:15','2020-05-27 18:37:11','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p>\\n\\n</p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Para\\nusuarios<span style=\\\"vertical-align: baseline;\\\"> que buscan </span>un\\nequilibrio perfecto entre peso, potencia, consumo y dinamismo, tanto para\\ndentro de la ciudad como para hacerse escapadas de fin de semana.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong><br></strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><br></p>\",\"text_align\":\"left\"}','products','text+image','left'),(73,19,NULL,'2020-05-19 18:17:15','2020-05-19 18:17:15','{\"video\":\"https://www.youtube.com/watch?v=uibMy5Sn2uw\"}','products','video','left'),(74,6,'uploads/product_descriptions/74.','2020-05-19 18:24:30','2020-09-18 19:07:53','{\"color\":\"gray\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">¿ Por\\nqué<span style=\\\"vertical-align: baseline;\\\">?</span></span></strong></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Manejo:\\n</strong></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">El<span style=\\\"vertical-align: baseline;\\\"> centro de gravedad alto, su </span>conducción\\nágil y su postura de conducción erguida permiten que la CB500X conquiste\\ncualquier terreno sin apenas esfuerzo.</span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Inspiración:</strong></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Tiene\\nun diseño resistente que te empuja hacia<span style=\\\"vertical-align: baseline;\\\">\\nlas</span>\\naventuras. Inspirada en la Africa Twin, combina líneas resistentes con una\\nestampa agresiva. Su<span style=\\\"vertical-align: baseline;\\\">\\nresitente</span>\\nparabrisas te proporcionará<span style=\\\"vertical-align: baseline;\\\">\\n</span>una\\ntotal visibilidad, seguridad, y comodidad.</span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Extra:</strong></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Cuenta con suspensión de largo recorrido\\ny una rueda delantera de 19 pulgadas, incluyendo varias mejoras para el\\noff-road.</span></span></p>\",\"text_align\":\"right\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(75,6,'uploads/product_descriptions/75.','2020-05-19 18:24:30','2020-09-18 19:07:53','{\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><span style=\\\"vertical-align: baseline;\\\">Una</span> conducción ágil y de postura erguida,\\npermiten que la CB500X conquiste cualquier terreno sin apenas esfuerzo. Así,\\ntanto si estás atravesando la jungla urbana o adentrándote en territorios\\ninexplorados, tendrás siempre lo que necesitás para escapar de la rutina.</span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Es\\npara aquellos que tengan un espíritu libre y que quieran conquistar la jungla\\nurbana. Con el potente motor de dos cilindros y una suspensión de largo\\nrecorrido, ha sido diseñada para tus aventuras.</span></span></p><p>\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n</p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Al\\nigual que sus hermanas CBR más grandes, un embrague antirrebote asistido\\nfacilita las subidas de marcha y gestiona el bloqueo de la rueda trasera en\\ncambios bruscos.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><br></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(133,6,NULL,'2020-11-26 20:28:50','2020-11-26 20:28:50','{\"video\":\"https://www.youtube.com/watch?v=OwkErpZ2Fss&t=10s\"}','products','video','left'),(79,24,'uploads/product_descriptions/79.','2020-05-19 18:38:36','2020-05-27 18:39:29','{\"color\":\"red\",\"t