;\\\"><span style=\\\"font-size: 0.9rem;\\\">Es\\nuna moto confiable con motor de cuatro tiempos, de un solo cilindro de 149 cc\\nenfriado por aire, lo que produce una potencia suave, ideal para los\\nciclistas recreativos. El carburador de 24 mm ofrece una excelente respuesta\\ndel acelerador.</span></span></span></p>\",\"text_align\":\"right\",\"top_line_alignment\":\"right\"}','products','text+image','left'),(94,43,'uploads/product_descriptions/94_1591019601_4762.webp','2020-05-26 01:57:53','2020-09-18 19:06:04','{\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\">Descripción:</span></strong></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-size: 0.9rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"vertical-align: baseline;\\\">Se\\ndestaca especialmente por el peso. Diseñada para aquellos que quieran\\ndisfrutar el momento, iniciando con una cilindra baja y un </span><span style=\\\"vertical-align: baseline;\\\">tanque\\nde combustible de 7 litros. La CRF150 posee un motor muy económico de cuatro tiempos, excelente para realizar intervalos extendidos</span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-size: 0.9rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"vertical-align: baseline;\\\">.</span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"vertical-align: baseline;\\\"><span style=\\\"font-size: 1.2rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><br></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><br></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(97,7,'uploads/product_descriptions/97_1591020447_8154.webp','2020-05-26 02:07:34','2020-09-18 19:06:49','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><span style=\\\"vertical-align: baseline;\\\">La\\nCRF 250 Rally es la indicada para pilotos menos experimentados, pero que les\\ngusta la aventura sobre tierra. O</span>frece un auténtico sabor de aventura a\\nlos motoristas que prefieren una máquina ligera y fácil de manejar. Moviéndose\\npor el mundo o moviéndose por la ciudad, la CRF250 RALLY es perfecta para<span style=\\\"vertical-align: baseline;\\\"> cualquier suelo</span>.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 1.2rem;\\\"><br></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><br></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(99,11,'uploads/product_descriptions/99_1591021598_4193.jpeg','2020-05-26 18:53:42','2020-06-01 19:26:38','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Para\\ncompeticiones de clase en enduros</span><span style=\\\"font-size: 0.9rem; vertical-align: baseline;\\\">\\ncon un botón de selección de modo de motor. </span><span style=\\\"font-size: 0.9rem;\\\">Este simple botón montado en el manillar\\nle permite marcar el carácter de entrega de potencia del motor con solo\\npresionar un pulgar.&nbsp;Elija entre Estándar, Suave y Agresivo, según las\\ncondiciones del curso.</span><span style=\\\"font-size: 1.2rem;\\\"><br>\\n</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 1.2rem;\\\"><br></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><br></p>\",\"text_align\":\"left\"}','products','text+image','left'),(101,42,'uploads/product_descriptions/101_1591020957_7244.jpeg','2020-05-26 19:23:59','2020-06-01 19:15:57','{\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><strong style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 1.2rem;\\\">¿ Por qué<span style=\\\"vertical-align: baseline;\\\">?</span></span></strong></p><p>\\n\\n</p><p style=\\\"line-height: normal; margin: 0pt 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Es\\nuna moto para usar con los amigos, para un buen enduro con trepadas y caminos\\ntrabados. Con muy buena respuesta frente a cualquier obstáculo gracias a su\\npotencia y peso.&nbsp;</span></sp