\nmoto que utiliza como base la CRF250R, con especificaciones para Enduro.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Aro\\ntrasero de 18 pulgadas, con llantas negras y nueva pinza de freno\\ndelantero.&nbsp;</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Suspensiones\\ndelanteras más suaves adaptadas al enduro.&nbsp;</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Motor\\ncon Launch Control&nbsp; HRC de 3 niveles.</span></span></p>\",\"text_align\":\"left\"}','products','text+image','left'),(104,27,'uploads/product_descriptions/104_1591021434_787.jpeg','2020-05-26 19:31:53','2020-11-26 21:58:30','{\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Creada\\npara entusiastas del off road con una potencia de 450cc, con entradas perfectas\\nen curvas y saltos.</span></span></p