rection: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Inspiración:</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">La\\nmoto gira entorn<span style=\\\"vertical-align: baseline;\\\">o a\\nla diversión. Su tamaño y sus líneas hacen que esta moto le quede bien a\\ncualquier persona. Muchos la llaman \\\"la nueva DAX\\\". Una moto para\\ndisfrutar con todas las generaciones.</span></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Extra:</strong></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Una\\nmoto urbana compacta pensada</span></span><span style=\\\"vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">\\npara disfrutar en cualquier circunstancia, con un moderno y potente motor a\\ninyección.</span></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; vertical-align: baseline;\\\"><span style=\\\"vertical-align: baseline;\\\"></span></p>\",\"text_align\":\"right\"}','products','text+image','left'),(106,35,'uploads/product_descriptions/106_1591023481_8441.jpeg','2020-05-26 19:39:04','2020-06-01 19:58:01','{\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\">Descripción:</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Todos\\ntenemos que llegar a algún lugar, día día en la vida. ¿Por qué no hacerlo\\ndivertido? Y la mejor manera de hacerlo, </span><span style=\\\"font-size: 0.9rem;\\\">naturalmente, es en un Honda Grom.\\nHaceé un test ride en este juego de atracciones de dos ruedas de tamaño de\\nbolsillo,<span style=\\\"vertical-align: baseline;\\\"> </span>y quedarás enganchado.<span style=\\\"vertical-align: baseline;\\\"> U</span>na vez que tengas esa sonrisa unida\\npermanentemente a tu cara, comenzarás a notar que<span style=\\\"vertical-align: baseline;\\\">\\nuna</span> gran\\nmotocicleta, es la Grom.&nbsp;</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-size: 0.9rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\">Su\\nmotor de 125 cc, construido con la calidad y confiabilidad típicas de Honda, te\\nofrecerá una conducción sin complicaciones. Los principiantes adorarán el peso\\nliviano y el tamaño accesible, pero incluso, los motociclistas experimentados\\nno pueden resistir la maniobrabilidad y el factor de diversión total de Grom.</span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\"><br></span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><br></p>\",\"text_align\":\"left\"}','products','text+image','left'),(107,34,'uploads/product_descriptions/107_1594665363_9865.jpeg','2020-05-26 23:58:38','2020-09-18 19:08:10','{\"color\":\"gray\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>¿Por qué<span style=\\\"vertical-align: baseline;\\\">?</span></strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Manejo:&nbsp;\\n</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Honda\\nha hecho un modelo innovador con motor<span style=\\\"vertical-align: baseline;\\\">\\n</span>automático,\\nlo cual hace que su uso sea más fácil,<span style=\\\"vertical-align: baseline;\\\">\\ndivertido</span> y\\nque cualquier persona pueda manejarla sin inconvenientes.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Inspiración:</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Inspirada en las persona con actitud\\njuvenil, con ganas de ser diferente y personalizar su moto de acuerdo a su\\ngusto. Ideal para las personas que quieran adentrarse al mundo de las dos\\nruedas.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Extra:</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Al\\nprobarla, una sonrisa quedará impregnada en tu rostro.</span></span></p>\",\"text_align\":\"right\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(108,34,'uploads/product_descriptions/108_1594665363_9883.jpeg','2020-05-26 23:58:38','2020-09-18 19:08:10','{\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Este<span style=\\\"vertical-align: baseline;\\\"> modelo</span>,<span style=\\\"vertical-align: baseline;\\\">\\nf</span>ue<span style=\\\"vertical-align: baseline;\\\"> totalmente diseñado&nbsp;</span>para\\nlas<span style=\\\"vertical-align: baseline;\\\"> personas con espíritu </span>joven,\\nque<span style=\\\"vertical-align: baseline;\\\"> desean expresar toda</span> su\\npersonalidad<span style=\\\"vertical-align: baseline;\\\">\\nsobre ella.</span></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><span style=\\\"vertical-align: baseline;\\\">La</span> Navi es perfecta para transporte urbano\\no una salida con los amigos. Su desempeño a un&nbsp;bajo costo de combustible<span style=\\\"vertical-align: baseline;\\\"> y </span>fácil maniobrabilidad, hacen que sea un\\nproducto&nbsp;accesible&nbsp;para todos.</span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">La\\nmoto posee una potencia máxima de 7.92 HP, motor monocilíndrico de cuatro\\ntiempos, cilindraje de 109,19 cm3, arranque eléctrico, transmisión automática y\\n99 kilogramos de peso, de modo que, es muy liviana,<span style=\\\"vertical-align: baseline;\\\"> </span>y permite que sea sumamente cómoda.&nbsp;</span></span><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Su</span></span><span style=\\\"vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"> suspensión delantera telescópica y\\ntrasera hidráulica aguantan todo tipo de terreno. Inclusive lugares fuera del\\nasfalto. Comprobalo con nuestro grupo de Honda Paraguay.</span></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"vertical-align: baseline;\\\"></span></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(111,5,'uploads/product_descriptions/111_1591024520_6327.jpeg','2020-05-27 20:46:02','2020-09-18 19:02:58','{\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">¿ Por qué?</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Manejo:&nbsp;</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">El punto de equilibrio bajo de la moto, hace que la misma se pegue al asfalto con un andar que se siente seguro en el manillar.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Inspiración:</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Es una moto inspirada para el uso diario, viajes cortos, largos y económicos. Una de las motos más completas en cuanto a precio, equipamiento y performance.&nbsp;</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Extra:</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Los ingenieros llevaron el tanque de combustible debajo del asiento, para tener una baulera del tamaño de un casco, entre el piloto y el manillar.</span></span></p>\",\"text_align\":\"right\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(112,5,'uploads/product_descriptions/112_1591024520_6354.jpeg','2020-05-27 20:46:02','2020-09-18 19:02:58','{\"text\":\"<p><strong><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></p><p><span style=\\\"font-size: 0.9rem;\\\">La NC750X tiene un diseño compacto y resistente, junto con nuevas prestaciones que te permitirán explorar el mundo con comodidad y estilo.</span></p><p><span style=\\\"font-size: 0.9rem;\\\">Con su postura de conducción elevada tendrás la máxima visibilidad, además de agilidad y una excelente sensación de potencia y par; es la compañera perfecta, sea cual sea tu destino.&nbsp;</span></p><p><span style=\\\"font-size: 0.9rem;\\\">Por si fuera poco, con su impresionante consumo y su nivel de emisiones Euro 4 (emisiones de CO2 de solo 81 g/km), llegarás a tu destino con la máxima eficiencia, y ecológica.</span></p><p>&nbsp;</p><p><br></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(113,41,NULL,'2020-05-27 23:18:26','2020-05-27 23:18:26','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">¿ Para qué?</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Uso: Fines de semana y entre semana.&nbsp;</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Suelo: Asfalto&nbsp;</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 1.2rem;\\\"><br></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Características Principales:</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Testigo de reserva.<br></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Reloj horario.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Cuentakilómetros minimalista.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Llave lateral.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Diseño personalizado.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">llantas \\\"bobber\\\".</span></span></p><p style=\\\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\\ntext-indent:0in\\\"><span style=\\\"font-size: 11pt; font-family: Calibri; color: black;\\\"></span></p>\",\"text_align\":\"left\"}','products','text+image','left'),(114,41,NULL,'2020-05-27 23:18:26','2020-05-27 23:18:26','{\"color\":\"gray\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">¿ Por qué<span style=\\\"vertical-align: baseline;\\\">?</span></span></strong></span></p><p>\\n\\n</p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Una\\ncustom con esencia bobber, de líneas muy esenciales que realzan sus rotundos\\nvolúmenes. Está preparada para personalizarla con facilidad, por eso se pueden\\ndesmontar con rapidez tanto el asiento del pasajero como las estriberas. Honda\\ntiene preparada un extenso catálogo de accesorios para poder caracterizarla de\\nacuerdo a los gustos del usuario.</span></span></p>\",\"text_align\":\"right\"}','products','text+image','left'),(115,41,NULL,'2020-05-27 23:18:26','2020-05-27 23:18:26','{\"color\":\"red\",\"text\":\"<p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Descripción:</strong></span></span></p><p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Para usuarios con estilo callejero, la Rebel busca la máxima libertad sobre dos ruedas.&nbsp; La postura de conducción es relajada y permite abrir bien los brazos mientras disfrutas de la posición rebajada del asiento. Además, también resulta cómoda a bajas velocidades.</span></span></p><p><br></p>\",\"text_align\":\"left\"}','products','text+image','left'),(117,3,'uploads/product_descriptions/117_1594664528_6652.jpeg','2020-05-29 22:53:27','2020-07-13 22:22:08','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.1rem;\\\">¿Por qué<span style=\\\"vertical-align: baseline;\\\">?</span></span></strong></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Manejo:\\n</strong></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">El manillar alto, con una flexión de las\\nrodillas casi a 90 grados, dan la sensación de robustez y de mucha potencia,\\npero sobre todo, comodidad total al andar. Con una apariencia off-road y unas\\nlineas elegantes, hacen que éste modelo sea la lider de Honda, cuando se habla\\nde comodidad, potencia y enormes distancias. </span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Inspiración:</strong></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Esta motocicleta de carácter robusto.\\nEstá inspirada para viajes largos y aventureros.&nbsp; Con un aire Off-Road pero con lineas\\ndelicadas, dan la elegancia que merece a una persona que le gusta romper\\nfronteras sin perder el confort.</span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Extra:</strong></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">La\\ntecnología Unicam de Honda contribuye a las compactas dimensiones del motor, de\\n16 válvulas y 1237 cc. Esta configuración SOHC ayuda a reducir el peso y el\\ntamaño de las culatas, además de optimizar la forma de la cámara de combustión.</span></span></p>\",\"text_align\":\"right\"}','products','text+image','left'),(118,3,'uploads/product_descriptions/118_1594664528_6685.jpeg','2020-05-29 22:53:27','2020-07-13 22:22:08','{\"color\":\"gray\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Encuentra\\nun escape y libera tu pasión con esta fabulosa maxi trail no apta para\\ncardiacos; con su motor V4 y transmisión cardánica, te darás cuenta que los\\nlimites están en tu mente.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">La\\nVFR1200X cuenta con un motor V4 de 1237 cc, un avanzado chasis y un paquete\\nelectrónico que dispone de ABS combinado y sistema de control de tracción\\n(TCS),</span></span></p><p>\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n</p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">La\\nvibración de la VFR1200X, específicamente diseñada para proporcionar una gran\\nfuncionalidad y suavidad durante la conducción, queda prácticamente eliminada\\npor un ángulo de 76 grados entre las dos bancadas de cilindros y el cigüeñal\\ncon una fase de 28 grados entre las muñequillas del cigüeñal.</span></span></p>\",\"text_align\":\"left\"}','products','text+image','left'),(119,4,'uploads/product_descriptions/119_1594664760_095.jpeg','2020-05-30 01:27:12','2020-07-13 22:26:00','{\"color\":\"gray\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">¿Por qué<span style=\\\"vertical-align: baseline;\\\">?</span></span></strong></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Manejo:\\n</strong></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><span style=\\\"vertical-align: baseline;\\\">El centro de gravedad bajo, hacen que la\\nsensación de manejo cambie a la mitad del rpm máximo, dando la máxima potencia\\nen los cuatro cilindros hasta la siguiente marcha. Uno puede notar este cambio\\nen el sonido del motor con una agresividad inigual. P</span>ara\\ncrear una moto versátil con actitud<span style=\\\"vertical-align: baseline;\\\">\\nde una moto mayor de 800Cc.</span></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Inspiración:</strong></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Ésta deportiva del turismo satisface a\\nlos pilotos más exigentes. Diseñada para los amantes de las motos con mucha\\npotencia y torque. En definitiva, la Corssrunner superará sus espectativas.</span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Extra:</strong></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><span style=\\\"vertical-align: baseline;\\\">Su\\ntecnología VTEC en el motor con sus accesorios como calienta puños, control de\\ntracción </span>HSTC,<span style=\\\"vertical-align: baseline;\\\"> </span></span></span><span style=\\\"vertical-align: baseline;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">etc,\\nhacen que este modelo te envuelva con su tecnología de última generación.</span></span></span></p><p style=\\\"line-height: normal; margin: 0pt 0in; word-break: normal;\\\"><span style=\\\"vertical-align: baseline;\\\"></span></p>\",\"text_align\":\"right\"}','products','text+image','left'),(120,4,'uploads/product_descriptions/120_1594664760_0966.jpeg','2020-05-30 01:27:12','2020-07-13 22:26:00','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-size: 0.9rem;\\\"><span style=\\\"vertical-align: baseline;\\\">Para\\nlas personas que buscan un carenado esteticamente con diseño agresivo y\\ndeportivo, y con su alta potencia y velocidades máximas, hacen de éste modelo\\nun fuerte exponente para superar espectativas de cualquier cliente, adueñandose\\nde las rutas con una presencia imposible de dar por alto</span>.</span></p><p>\\n\\n\\n\\n\\n\\n</p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-size: 0.9rem;\\\">La\\nnueva VFR800X Crossrunner ofrece un estilo deportivo y aventurero, potenciado\\ncon un motor V4-VTEC mejorado y suspensión tensa de largo recorrido. Y también\\nes muy práctica, ya que dispone completamente de luces LED en los faros\\ndelanteros y traseros, 5 puños calefactados con 5 niveles y asiento de altura\\najustable.&nbsp;</span></p>\",\"text_align\":\"left\"}','products','text+image','left'),(121,29,NULL,'2020-06-01 19:41:02','2020-06-01 19:41:02','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">¿Por qué<span style=\\\"vertical-align: baseline;\\\">?</span></span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Manejo:&nbsp;\\n</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><font face=\\\"Nexa, Helvetica Neue, Helvetica, Arial, sans-serif\\\"><span style=\\\"font-size: 0.9rem;\\\">Con\\nésta motocicleta vas a poder vivir tu </span></font><font face=\\\"Nexa, Helvetica Neue, Helvetica, Arial, sans-serif\\\" size=\\\"1\\\">día</font><font face=\\\"Nexa, Helvetica Neue, Helvetica, Arial, sans-serif\\\"><span style=\\\"font-size: 0.9rem;\\\">&nbsp;a día con un andar suave y</span></font><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 0.9rem; vertical-align: baseline;\\\"> seguro. Tiene un motor semi automático\\nsin embrague, de fácil manejo y maniobrabilidad, especial para la ciudad</span><font face=\\\"Nexa, Helvetica Neue, Helvetica, Arial, sans-serif\\\"><span style=\\\"font-size: 0.9rem;\\\">.</span></font></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Inspiración:</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Inspirada en todas las personas que\\nnecesitan un transporte seguro, fácil y&nbsp;\\nduradero. Especial para mujeres que empiezan a utilizar una motocicleta.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Extra:</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 9px; font-family: &quot;Source Sans Pro&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\">Sus líneas aerodinámicas proyectan un estilo más deportivo y moderno.</span><span style=\\\"font-size: 0.9rem;\\\">:<br></span></span></p>\",\"text_align\":\"right\"}','products','text+image','left'),(122,29,NULL,'2020-06-01 19:41:02','2020-06-01 19:41:02','{\"color\":\"gray\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-size: 0.9rem;\\\"><span style=\\\"vertical-align: baseline;\\\">Ideal\\npara usuarios que buscan un diseño deportivo económico para movilidad diaria, </span>Su\\nmotor 110cc refrigerado por aire, brinda mayor eficiencia en tus viajes, además\\nde una mayor durabilidad y resistencia,<span style=\\\"vertical-align: baseline;\\\">\\n</span><span style=\\\"vertical-align: baseline;\\\">de\\nfácil manejo y con un motor bajo en vibraciones.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-size: 0.9rem;\\\">Fabricada\\ncon excelentes materiales, su comprobada durabilidad se refleja en una mayor\\nvida útil de la moto, seguridad y confort&nbsp;de manejo.</span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Cuenta\\ncon una excelente<span style=\\\"vertical-align: baseline;\\\"> </span>maniobrabilidad\\ngracias a su cuerpo ligero, que sumado a su asiento doble, la convierten en la\\nopción ideal para moverte por la ciudad todos los días.</span></span></p>\",\"text_align\":\"left\"}','products','text+image','left'),(123,10,'uploads/product_descriptions/123_1594666321_0784.jpeg','2020-06-01 23:29:51','2020-07-13 22:52:01','{\"color\":\"gray\",\"text\":\"<p style=\\\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\\ntext-indent:0in\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 1.2rem;\\\"><span style=\\\"color: black; font-weight: bold;\\\">¿ Por qué</span><span style=\\\"color: black; font-weight: bold; vertical-align: baseline;\\\">?</span></span></span></p><p style=\\\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\\ntext-indent:0in\\\"><span style=\\\"font-size: 0.9rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\">La\\npotencia y versatilidad de la Honda XR 250 Tornado, la convierten en una\\nmotocicleta con dos personalidades que conviven en perfecta armonía. Se\\ndesplaza con total naturalidad en el día a día como una ágil moto de calle y\\nofrece una increíble explosión de adrenalina en cada salida off-road</span></p>\",\"text_align\":\"right\"}','products','text+image','left'),(124,10,'uploads/product_descriptions/124_1594666321_081.jpeg','2020-06-01 23:29:51','2020-07-13 22:52:01','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p>\\n\\n</p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Es\\nuna excelente elección para quienes buscan el equilibrio justo entre movilidad\\ny nuevas experiencias.&nbsp;</span></span></p>\",\"text_align\":\"left\"}','products','text+image','left'),(125,13,'uploads/product_descriptions/125_1594664608_3766.jpeg','2020-06-02 18:05:52','2020-09-18 19:05:42','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">¿ Por qué<span style=\\\"vertical-align: baseline;\\\">?</span></span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Manejo:&nbsp;\\n</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Es una moto con el centro de gravedad\\nalto. Liviana, con un chasis de fácil maniobrabilidad para el off-road. Hacen\\ndel modelo una de las mejores motocicletas todo terreno.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Inspiración:</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Inspirada en los amantes del off-road.\\nUna moto que no tiene límites. Especial para el trabajo de campo y el día a\\ndía.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Extra:</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Diseño agresivo, aerodinámico y\\ndeportivo. Con tecnología de baja fricción, con bajo consumo. Con suspensión\\ntrasera de nitrógeno a presión.&nbsp;&nbsp;</span></span></p>\",\"text_align\":\"right\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(126,13,'uploads/product_descriptions/126_1594664608_3784.jpeg','2020-06-02 18:05:52','2020-09-18 19:05:42','{\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Con\\nuna combinación de estilo y eficiencia, la nueva Honda XR150 está pensada para\\nacompañarte en cualquier ocasión. Este nuevo modelo te permite realizar tus\\nrecorridos multipropósito con estilo. Viene con un diseño gráfico novedoso,\\nsiguiendo la línea de su hermana mayor, la XR190L.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Motor<span style=\\\"vertical-align: baseline;\\\"> de m</span>ayor torque y más eficiente gracias\\na su mejor rendimiento y transmisión mecánica de 5 velocidades.&nbsp;</span></span></p><p>\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n</p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Una\\nsuspensión trasera basculante de doble brazo con monoamortiguador hidráulico y\\nresorte helicoidal; en fin,&nbsp; una\\nverdadera motocicleta totalmente multipropósito.</span></span></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(127,12,'uploads/product_descriptions/127_1594664323_5969.jpeg','2020-06-05 18:08:34','2020-09-18 19:09:43','{\"color\":\"red\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">¿Por qué<span style=\\\"vertical-align: baseline;\\\">?</span></span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Manejo:&nbsp;\\n</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Es una moto con el centro de gravedad\\nalto. Liviana, con un chasis de fácil maniobrabilidad para el off-road,\\nconvirtiéndose así, en la mejor motocicleta todo terreno.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Inspiración:</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Inspirada en los amantes del off-road.\\nUna moto que no tiene límites. Especial para el trabajo de campo y el dia a\\ndía.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><strong>Extra:</strong></span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-size: 0.9rem; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline;\\\">Motor a in</span><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\"><span style=\\\"vertical-align: baseline;\\\">yección </span>PGM-FI y más potente de 190Cc. que su antecesor, la XR150.</span></span></p>\",\"text_align\":\"right\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(128,12,'uploads/product_descriptions/128_1594664323_6012.jpeg','2020-06-05 18:08:34','2020-09-18 19:09:43','{\"color\":\"gray\",\"text\":\"<p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"vertical-align: baseline; font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.2rem;\\\">Descripción:</span></strong></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 0.9rem;\\\">La\\nnueva Honda XR190L representa fielmente la esencia ON-OFF de la familia XR. Es\\nuna moto diseñada para responder tanto en caminos urbanos como en terrenos\\nagrestes o dificultosos,<span style=\\\"vertical-align: baseline;\\\"> así\\ncomo también, </span>en\\ntus recorridos diarios o las escapadas de fin de semana. No importa el destino,\\nla XR 190L </span><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">está siempre lista.</span></span></p><p style=\\\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in;\\\"><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Cuenta<span style=\\\"vertical-align: baseline;\\\"> con un </span>sistema de alimentación PGM-Fi\\nexclusivo de Honda, de inyección de combustible electrónico-digital para\\nmotores de combustión interna, que inyecta la cantidad correcta de combustible\\na los cilindros según la demanda del motor, para lograr el equilibrio perfecto\\nentre rendimiento, dinámica de respuesta y economía de combustible. Además, la\\nXR 190L cuenta con un tanque de 12 litros con reserva de 3,5 incluída, para\\nrecorrer grandes distancias sin problemas.</span></span></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left'),(130,45,'uploads/product_descriptions/130_1595279407_5497.webp','2020-07-21 01:10:07','2020-07-21 01:10:07','{\"text\":\"<p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.3rem;\\\">Descripción:&nbsp;</span></strong><span style=\\\"font-size: 0.9rem;\\\">&nbsp;</span></span></p><p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Su diseño para trabajo de fuerza está acompañado de su sistema de suspensión sobre las cuatro ruedas dando una mayor comodidad de andar y manejo.&nbsp;</span></span></p><p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">El motor del TRX250TM permite una alineación directa del eje de transmisión a las ruedas traseras. Ningún terreno le es un obstáculo para andar. Otro aspecto importante es su fácil y bajo mantenimiento.</span></span></p>\",\"text_align\":\"left\"}','products','text+image','left'),(131,46,'uploads/product_descriptions/131_1595279580_0598.jpeg','2020-07-21 01:13:00','2020-09-18 19:09:03','{\"text\":\"<p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 1.3rem;\\\">¿Por qué?</span></strong></span></p><p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">Su chasis tiene gran resistencia y capacidad. Con este ATV podrás llevar prácticamente cualquier elemento y además remolcar cargas pesadas.</span></span></p><p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 1.2rem;\\\"><strong>Descripción:&nbsp;&nbsp;</strong></span></span></p><p><span style=\\\"font-family: Nexa, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\\\"><span style=\\\"font-size: 0.9rem;\\\">El TRX420 posee un motor alimentado por inyección el cual le brinda una mayor eficiencia en la combustión y desempeño. El TRX420 posee un gran diseño, acompañado de confort tanto para los arduos días de trabajo, como para los tiempos libre.&nbsp;</span></span></p>\",\"text_align\":\"left\",\"top_line_alignment\":\"left\"}','products','text+image','left');
