INSERT INTO `news` VALUES (3,'Honda, un estilo de vida que se impone en Paraguay','<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\"><em><u><span style=\"font-size:12.0pt;line-height:\r\n107%\">Valor agregado que hace la diferencia<o:p></o:p></span></u></em></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\"><strong><span style=\"font-size:16.0pt;mso-bidi-font-size:\r\n12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span></strong></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\"><strong><span style=\"font-size:16.0pt;mso-bidi-font-size:\r\n12.0pt;line-height:107%\">Honda, un estilo de vida que se impone en Paraguay<o:p></o:p></span></strong></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\"><span style=\"font-size:12.0pt;line-height:107%\">La pirámide de DIESA en la EXPO 2019\r\nfue sede de la Noche Honda. Clientes, amigos y prensa se dieron cita para\r\ncompartir experiencias y novedades de la marca japonesa.<o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-size:12.0pt;line-height:107%\">A la bien conocida\r\ncalidad de las motos Honda, ahora se suma una comunidad creciente de moteros\r\nque “hablan el mismo lenguaje” y realizan las más variadas actividades sobre\r\ndos ruedas.<o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-size:12.0pt;line-height:107%\">“Desde una salida\r\ninformal con una Honda Neo Café hasta un paseo rutero en pareja con una CB500.\r\nDesde una carrera con motos Grom en el Kartódromo hasta competiciones de Moto\r\nGP en pistas extranjeras. Honda en Paraguay ofrece cada vez más experiencias\r\nllenas de adrenalina y diversión”, comentó Miguel Carrizosa, presidente y\r\ndirector gerente de DIESA. <o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-size:12.0pt;line-height:107%\">Mencionó el orgullo\r\nque representa para DIESA ofrecer al público paraguayo la moto número uno del\r\nmundo, con todo lo que eso significa en términos de seguridad, economía y\r\nconfianza. Sin dudas, la moto con mayor valor agregado. A esto suma la\r\nsatisfacción de ver crecer una comunidad de usuarios realmente apasionados por\r\nla marca. <o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-size:12.0pt;line-height:107%\">Esteban Carrizosa,\r\ngerente de motos Honda en el país, dijo que “nosotros ofrecemos mucho más que\r\nuna máquina, le damos la posibilidad al cliente de subirse a un estilo de vida,\r\na vivir un lenguaje común, a sentir la libertad de una marca fascinante”. <o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-size:12.0pt;line-height:107%\">Mencionó que la\r\ncomunidad Honda arma sus propios planes y recorridos. “En Honda conviven los\r\nmás variados grupos. Las experiencias de Aventura, Off Road, Competición y\r\nVelocidad están cobrando cada vez más fuerza. Ni qué hablar de los encuentros y\r\nsalidas de fines de semana por todo el territorio nacional”, comentó. Agregó\r\nque logros de competición de los pilotos Honda es otro motivo más de celebración.<o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-size:12.0pt;line-height:107%\">De hecho, pilotos y\r\nmiembros de la comunidad contaron sus anécdotas en la Expo y recordaron la\r\nimportancia de tener un sueño y salir a buscarlo. El evento contó con un gran\r\nshow de motos, con acrobacias fuera de serie. Hasta se sumó una viajera colombiana,\r\nque está recorriendo toda Latinoamérica en su Honda. <o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-size:12.0pt;line-height:107%\">Además, Diesa\r\naprovechó la ocasión para mostrar sus novedades. Las recién llegadas estrellas\r\nson:<o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-size:12.0pt;line-height:107%\">CB500X: Nuevo diseño\r\nde la familia City Bike, tamaño ideal, para moverse con agilidad y comodidad\r\ntanto en ciudad como ruta.<o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-size:12.0pt;line-height:107%\">XR650L: Pura\r\npotencia... que más decir de un motor monocilindrico de 650 cc, una moto de\r\ncorazón todo terreno, diseño vintage imparable en todo sentido.<o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-size:12.0pt;line-height:107%\">CB650R: Modelo\r\nultramoderna perfectamente adaptada a un diseño vintage, potente motor de 95 cv\r\nllamando la atención de quien se cruce en su camino por su atractivo sonido de\r\n4 cilindros, luces led 100% hacen que su andar nocturno no pase desapercibido <o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-size:12.0pt;line-height:107%\">CRF250F: Diversión\r\ngarantizada en la sucesora de la CRF230, creada para disfrutar con seguridad su\r\nandar en los terrenos más complicados<o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-size:12.0pt;line-height:107%\">Africa Twin: La\r\nverdadera big trail, desde su lanzamiento en 2016 llega la nueva versión con mejoras\r\ncomo, acelerador electrónico, 4 modos de conducción, mejora en la admisión para\r\nmayor torque.<o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt\"><span style=\"font-size:12.0pt;line-height:107%\">La noche cerró con un concierto de\r\nRock, al más puro estilo motero. Los interesados en seguir las acciones de\r\nHonda Paraguay pueden seguir a la marca en redes sociales como @hondamotospy e\r\ningresar a </span><a href=\"http://www.hondamotos.com.py/\"><span style=\"font-size:12.0pt;line-height:107%\">www.hondamotos.com.py</span></a><span style=\"font-size:12.0pt;line-height:107%\"><o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:107%\"><o:p>&nbsp;</o:p></span>','2019-07-16','uploads/news/3.jpg','uploads/news/3_thumbnail.jpg','2019-07-18 01:08:52','2019-07-18 19:22:00');
/*!40000 ALTER TABLE `news` ENABLE KEYS */;
