INSERT INTO `product_descriptions` VALUES (1,2,'<h1>EL MUNDO TE ESPERA</h1>\r\n\r\n<p style=\"language:es-PY;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">En su version DCT posee una caja\r\nintuitiva que permite al piloto conentrarse exclusivamente en la conducción.</span></p><p><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">La\r\nAfrica Twin Adventure Sports tiene un depósito de combustible de gran\r\ncapacidad, suspensión de largo recorrido para una mayor distancia libre al\r\nsuelo, y una mejor protección frente a las inclemencias climatológicas. El\r\nacelerador electrónico incorpora 3 modos de conducción, además de un modo G\r\nadicional para viajes off-road, así como una serie de prestaciones innovadoras\r\npara llevarte más lejos que nunca. Para el toque final, la hemos pintado con\r\ncolores especiales para celebrar y conmemorar el 30° aniversario de la moto.\r\nParece que todo está listo para comenzar. ¿Y vos, estás preparado?</span></p>','uploads/products/2_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(2,3,'<!--StartFragment-->\r\n\r\n<p style=\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size:11.0pt;font-family:Calibri;mso-ascii-font-family:\r\nCalibri;mso-fareast-font-family:+mn-ea;mso-bidi-font-family:+mn-cs;mso-ascii-theme-font:\r\nminor-latin;mso-fareast-theme-font:minor-fareast;mso-bidi-theme-font:minor-bidi;\r\ncolor:black;mso-color-index:13;language:es;font-weight:bold;mso-style-textfill-type:\r\nsolid;mso-style-textfill-fill-themecolor:dark1;mso-style-textfill-fill-color:\r\nblack;mso-style-textfill-fill-alpha:100.0%\">¿Para</span><span style=\"font-size:\r\n11.0pt;font-family:Calibri;mso-ascii-font-family:Calibri;mso-fareast-font-family:\r\n+mn-ea;mso-bidi-font-family:+mn-cs;mso-ascii-theme-font:minor-latin;mso-fareast-theme-font:\r\nminor-fareast;mso-bidi-theme-font:minor-bidi;color:black;mso-color-index:13;\r\nlanguage:es;font-weight:bold;vertical-align:baseline;mso-text-raise:0%;\r\nmso-style-textfill-type:solid;mso-style-textfill-fill-themecolor:dark1;\r\nmso-style-textfill-fill-color:black;mso-style-textfill-fill-alpha:100.0%\"> que?</span></p>\r\n\r\n<p style=\"language:es-PY;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;direction:ltr;unicode-bidi:\r\nembed;vertical-align:baseline;mso-line-break-override:none;word-break:normal;\r\npunctuation-wrap:hanging\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\"><strong><em>Uso:</em>\r\n</strong>Diversión, viajes.</span></p>\r\n\r\n<p style=\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in;direction:ltr;unicode-bidi:embed;vertical-align:baseline\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\"><strong><em>Suelo:</em>&nbsp;</strong> </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Asfalto, Off-road</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> light.</span></p>\r\n\r\n<p style=\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in;direction:ltr;unicode-bidi:embed;vertical-align:baseline\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\"><strong><em>Distacia:</em>\r\n</strong>Media y largas.</span></p><span style=\"font-size: 11pt; font-family: Calibri; color: black;\"><br></span>\r\n\r\n<!--EndFragment-->\r\n\r\n\r\n\r\n\r\n\r\n<!--StartFragment-->\r\n\r\n<p style=\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size:11.0pt;font-family:Calibri;mso-ascii-font-family:\r\nCalibri;mso-fareast-font-family:+mn-ea;mso-bidi-font-family:+mn-cs;mso-ascii-theme-font:\r\nminor-latin;mso-fareast-theme-font:minor-fareast;mso-bidi-theme-font:minor-bidi;\r\ncolor:black;mso-color-index:13;language:es;font-weight:bold;mso-style-textfill-type:\r\nsolid;mso-style-textfill-fill-themecolor:dark1;mso-style-textfill-fill-color:\r\nblack;mso-style-textfill-fill-alpha:100.0%\">¿Por que</span><span style=\"font-size:11.0pt;font-family:Calibri;mso-ascii-font-family:Calibri;\r\nmso-fareast-font-family:+mn-ea;mso-bidi-font-family:+mn-cs;mso-ascii-theme-font:\r\nminor-latin;mso-fareast-theme-font:minor-fareast;mso-bidi-theme-font:minor-bidi;\r\ncolor:black;mso-color-index:13;language:es;font-weight:bold;vertical-align:\r\nbaseline;mso-text-raise:0%;mso-style-textfill-type:solid;mso-style-textfill-fill-themecolor:\r\ndark1;mso-style-textfill-fill-color:black;mso-style-textfill-fill-alpha:100.0%\">?</span></p>\r\n\r\n<p style=\"language:es-PY;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><u><span style=\"font-size: 11pt; font-family: Calibri; color: black; font-weight: bold;\">Manejo:\r\n</span></u></p>\r\n\r\n<p style=\"language:es-PY;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">El manillar alto, con una flexión de las\r\nrodillas casi a 90 grados. Y sus 4 cilindros con 1.200 Cc. a cardán, hacen que\r\néste modelo tenga un andar robusto, con mucha potencia pero cómoda a la vez.\r\nCon una apariencia off-road y unas lineas elegantes hacen que éste entre los modelos top de Honda, cuando se habla de comodidad, potencia y largas distancias. Al\r\nmanejar la moto uno tiene la sensación que puede llevar todo por delante.</span></p><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"><br></span>\r\n\r\n\r\n\r\n<p style=\"language:es-PY;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><u><span style=\"font-size: 11pt; font-family: Calibri; color: black; font-weight: bold; vertical-align: baseline;\">Inspiracion:</span></u></p>\r\n\r\n<p style=\"language:es-PY;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">Ésta motocicleta de carácter robusto.\r\nEstá inspirada para viajes largos y aventureros.&nbsp; Con un aire Off-Road pero con lineas\r\ndelicadas. Dan la elegancia que merece una persona que le gusta romper\r\nfronteras sin perder la comodidad.</span></p>\r\n\r\n\r\n\r\n<p style=\"language:es-PY;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><u><span style=\"font-size: 11pt; font-family: Calibri; color: black; font-weight: bold; vertical-align: baseline;\"><br></span></u></p><p style=\"language:es-PY;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><u><span style=\"font-size: 11pt; font-family: Calibri; color: black; font-weight: bold; vertical-align: baseline;\">Extra:</span></u></p>\r\n\r\n<p style=\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">La\r\ntecnología Unicam de Honda contribuye a las compactas dimensiones del motor, de\r\n16 válvulas y 1237 cc. Esta configuración SOHC ayuda a reducir el peso y el\r\ntamaño de las culatas, además de optimizar la forma de la cámara de combustión.</span></p>\r\n\r\n<!--EndFragment-->','uploads/products/3_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(3,4,'<h1><p style=\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size:11.0pt;font-family:Calibri;mso-ascii-font-family:\r\nCalibri;mso-fareast-font-family:+mn-ea;mso-bidi-font-family:+mn-cs;mso-ascii-theme-font:\r\nminor-latin;mso-fareast-theme-font:minor-fareast;mso-bidi-theme-font:minor-bidi;\r\ncolor:black;mso-color-index:13;language:es;font-weight:bold;vertical-align:\r\nbaseline;mso-text-raise:0%;mso-style-textfill-type:solid;mso-style-textfill-fill-themecolor:\r\ndark1;mso-style-textfill-fill-color:black;mso-style-textfill-fill-alpha:100.0%\">Descripcion:</span></p>\r\n\r\n<p style=\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">para\r\nlas personas que buscan un carenado esteticamente diseñado con alta potencia y\r\nvelocidades máximas con suspensiones que </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">disponen de un recorrido mayor.</span></p>\r\n\r\n<p style=\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size:11.0pt;font-family:Calibri;mso-ascii-font-family:\r\nCalibri;mso-fareast-font-family:+mn-ea;mso-bidi-font-family:+mn-cs;mso-ascii-theme-font:\r\nminor-latin;mso-fareast-theme-font:minor-fareast;mso-bidi-theme-font:minor-bidi;\r\ncolor:black;mso-color-index:13;language:es;mso-style-textfill-type:solid;\r\nmso-style-textfill-fill-themecolor:dark1;mso-style-textfill-fill-color:black;\r\nmso-style-textfill-fill-alpha:100.0%\">Equipada con un potente motor V4 Hiper\r\nVtec, </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">luces\r\nLED en los faros delantero y trasero,&nbsp;</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">ABS y control de tracción. Asiento y p</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">arabrisas regulable en altura.&nbsp;</span></p></h1>','uploads/products/4_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(4,5,'<h1>EL MUNDO TE ESPERA</h1><p>La NC750X te llevará a explorar lo desconocido.</p> <p>La NC750X tiene un diseño compacto y resistente, junto con nuevas prestaciones que te permitirán explorar con comodidad y estilo. Con su postura de conducción elevada tendrás la máxima visibilidad, además de agilidad y una excelente sensación de potencia y par; es la compañera perfecta, sea cual sea tu destino. Por si fuera poco, con su impresionante consumo y su nivel de emisiones Euro 4 (emisiones de CO2 de solo 81 g/km), llegarás a tu destino con la máxima eficiencia.</p>','uploads/products/5_description.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(5,6,'<h1>CB 500X</h1><p style=\"language:es-PY;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Ofrece</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> una</span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\"> postura de conducción</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> cómoda y relajada, </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">con\r\nmás suavidad y ligereza en toda la gama de RPM.&nbsp;</span><span style=\"text-indent: 0in; font-size: 11pt; font-family: Calibri; color: black;\">De Inspiración</span><span style=\"text-indent: 0in; font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">\r\nnacida</span><span style=\"text-indent: 0in; font-size: 11pt; font-family: Calibri; color: black;\"> en las calles,</span><span style=\"text-indent: 0in; font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> y\r\ncon mejoras en la suspensión, ahora puede llegar más lejos que antes con\r\nexcelentes prestaciones y economía.</span></p><p><span style=\"text-indent: 0in; font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"><span style=\"font-size: 11pt; text-indent: 0in;\">Su\r\nconducción ágil y su postura de conducción erguida permiten que la CB500X\r\nconquiste cualquier terreno sin apenas esfuerzo. Así, tanto si estás\r\natravesando la jungla urbana o adentrándote en territorios inexplorados,\r\ntendrás siempre lo que necesitas para escapar de la rutina.</span>&nbsp;</span></p>','uploads/product_descriptions/5.jpg','2019-04-29 17:09:14','2019-09-04 01:04:24'),(6,7,'<p><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Rápida,\r\nágil y fácil de conducir, es una máquina potente, con modificaciones que se\r\nadaptan perfectamente a su nuevo estilo de conducción por senderos o campo a\r\ntravés o para deslizarse por una colina, o apurar unos preciados segundos de\r\nuna prueba de conducción especial</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">mente\r\ninspiradora.</span></p><p><br></p>','uploads/products/7_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(7,8,'<h1>EL MUNDO TE ESPERA</h1><p><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Perfeccionada y diseñada para personas que le gusta el enduro. Con un perfil Off-road, amante de las\r\naventuras.&nbsp; No necesita mucha velocidad final porque es adecuada para ir en\r\ncaravanas con los amigos y por caminos trabados.</span><br></p>','uploads/products/8_description.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(8,9,'<p><span style=\"text-indent: 0in; vertical-align: baseline;\"><font color=\"#000000\" face=\"Calibri\"><span style=\"font-size: 14.6667px;\"><strong>Conducción deportiva para los pilotos más exigentes.</strong></span></font><br></span></p><p style=\"language:es-PY;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"text-indent: 0in; font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">Un\r\nprofundo rediseño que permitió a esta moto ganar 8 % más de potencia y perder\r\ncerca de 15 kilos. Además de incorportar 3 modos de conducción personalizable. </span><span style=\"text-indent: 0in; font-size: 11pt; font-family: Calibri; color: black;\">&nbsp;</span><br></p><p style=\"language:es-PY;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Aerodinámicamente\r\nperfecta; sólo tienes que subirte y disfrutar. Es totalmente estable tanto en\r\naltas velocidades en línea recta, como trazando las curvas más reviradas.</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> Fabricada </span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">para\r\nusuarios que buscan destacar en velocidad con un sonido característico de\r\nHonda.</span></p>','uploads/product_descriptions/8.jpg','2019-04-29 17:09:14','2019-08-27 18:26:36'),(9,10,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">La\r\npotencia y versatilidad de la Honda XR 250 Tornado la convierten en una\r\nmotocicleta con dos personalidades que conviven en perfecta armonía. Se\r\ndesplaza con total naturalidad en el día a día como una ágil moto de calle, y\r\nofrece una increíble explosión de adrenalina en cada salida off-road.</span></p>','uploads/products/10_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(10,11,'<p><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">La\r\nCRF450RX es nuestro misil Off-Road. Con las mismas actualizaciones de motor que\r\nla nueva CRF450R, incluido el control de lanzamiento HRC, perfora con más\r\nfuerza en toda su gama de revoluciones y desarrolla una velocidad devastadora\r\nsobre el suelo, desde pruebas especiales hasta pistas técnicas únicas. Y lo\r\nhace durante todo el tiempo.</span></p>','uploads/products/11_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(11,12,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in;direction:ltr;unicode-bidi:embed;vertical-align:baseline\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; &nbsp;Esta\r\nmoto es bastante cómoda, el manejo que tiene es sumamente amigable, sobre todo\r\npara personas que no tienen mucha experiencia andando en moto. La\r\nmaniobrabilidad&nbsp;es una</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">\r\nde las mejores cualidades en usos de terreno </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">, ya sea cemento o terrenos off road</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">monosuspensión con resorte progresivo.</span></p><p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; &nbsp; Posee\r\nla nueva tecnología PGM-FI (inyección electrónica) lo que otorga mayor\r\neficiencia y por lo tanto una mejora la autonomía.</span></p>','uploads/products/12_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(12,13,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; &nbsp;Su\r\ndiseño es atractivo y funcional</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">\r\n</span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">ya\r\nque</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">presenta un frente unificado de tanque, n</span><span style=\"color: rgb(0, 0, 0); font-family: Calibri; font-size: 14.6667px;\">eumaticos multiproposito con horquilla 160mm</span><span style=\"text-indent: 0in; font-size: 11pt; font-family: Calibri; color: black;\">, permite una conduccion optima en todo</span><span style=\"text-indent: 0in; font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> tipo de superficies con un bajo consumo de combustible.</span></p><p><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"></span></p><p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><br></p><p></p>','uploads/products/13_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(13,14,'<p style=\"language:es;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Esta</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">diseñada para los usuarios en busca\r\naventuras nuevas todos los días. Su potencia permite lograr un rendimiento\r\neficiente en cualquier tipo de camino</span></p>','uploads/products/14_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(14,15,'<p><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Para</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> pilotos </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">que buscan una motocicleta&nbsp;</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; font-weight: bold;\">deportiva\r\nde medio peso</span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">,\r\neconómica y de un uso más práctico que las grandes deportivas, con la que uno podrá irse a trabajar cada día disfrutando de las curvas. Cuenta c</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">on una posición baja del\r\nasiento, permitiendo a cualquier usuario llegar </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">con\r\ntoda seguridad al suelo.</span></p>','uploads/products/15_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(15,16,'<p style=\"language:es;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">Una\r\nbuena elección para clientes que buscan un balance entre el día laboral y el\r\nfin de semana, con un tamaño compacto, liviano; su chasis de aluminio es la base de lograr un excelente manejo.</span></p>','uploads/products/16_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(16,17,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Es\r\nuna moto que además de su versatilidad y diseño, es una de las más seguras al\r\nfrenar, para</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">\r\nusuarios con inicios en el segmento deportivo.</span></p><p><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"></span></p><p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt;\">Versión\r\nC-ABS,&nbsp;</span><span style=\"font-size: 11pt;\">cuadro de instrumentos digital multifunción, potente motor monocilíndrico, avanzada inyección de gasolina, elegante carenaje integral.</span></p>\r\n\r\n<p style=\"language:es;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><br></p><p></p>','uploads/products/17_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(17,18,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Muévete\r\ncon agilidad y destreza, frena y acelera a tu antojo. Ten el poder de la\r\nTwister en tus manos. Su motor de 250 cc. te ará el poder para llegar a donde\r\nquieras ir. Su diseño es elegantemente moderno y deportivo, con un tablero lcd súper ergonómico.</span><br></p>','uploads/products/18_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(18,19,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; Para\r\nusuarios</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> que buscan </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">un\r\nequilibrio perfecto entre peso, potencia, consumo y dinamismo, tanto para\r\ndentro de la ciudad como para hacerse una escapada de fin de semana.&nbsp;</span></p><span style=\"font-size: 11pt; font-family: Calibri; color: black;\"><br></span><p style=\"language:es;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; Una\r\naceleración impresionante, un estilo deportivo naked, la máxima precisión de\r\nconducción y una potencia a raudales que acelera tanto la moto como las\r\npulsaciones.</span></p>','uploads/products/19_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(19,20,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">La\r\nHonda NC750S es una naked muy versátil, económica y fácil de usar. Se destaca\r\npor contar con una versión del sistema Honda de doble embrague (DCT) con\r\ncambio semiautomático. El motor de la NC750S es un bicilíndrico en línea, con\r\nprácticamente toda la entrega en la zona baja y media de la dirección. Cuenta con maleta bajo el asiento, c</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">uentarevoluciones, r</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">eloj\r\nhorario, r</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">egulación\r\nde maneta de freno, Recordatorio de revisiones, t</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">emperatura\r\nde refrigerante,&nbsp;</span><span style=\"color: black; font-family: Calibri; font-size: 11pt;\">cambio DCT, entre otros.</span></p>','uploads/products/20_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(20,21,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">&nbsp; &nbsp;Las\r\nmás grandes no siempre son las mejores. Con la nueva&nbsp; CB650F usted obtiene más de lo\r\nque importa: rendimiento, aceleración, estilo y capacidad de manejo.</span></p>','uploads/products/21_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(21,22,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">&nbsp; &nbsp;Para\r\nusuarios con estilo callejero la </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Rebel busca la máxima libertad sobre dos\r\nruedas.</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp;La postura de conducción es\r\nrelajada y permite abrir bien los brazos mientras disfrutas de la posición\r\nrebajada del asiento. Además, también resulta cómoda a\r\nbajas velocidades.</span></p><span style=\"font-size: 11pt; font-family: Calibri; color: black;\"><br></span><p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; &nbsp; Está preparada para personalizarla con facilidad, por eso se pueden desmontar\r\ncon rapidez tanto el asiento del pasajero como las estriberas. Honda prepara\r\nun extenso catálogo de accesorios para poder caracterizarla de acuerdo a los\r\ngustos del usuario.</span></p>','uploads/products/22_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(22,23,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; Es\r\nperfecta para los usuarios que buscan&nbsp;\r\nencontrar una moto de aspecto deportivo y tecnológico, perfecta para el\r\ncorazón de la ciudad y sus alrededores.</span></p><span style=\"font-size: 11pt; font-family: Calibri; color: black;\"><br></span><p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; Cuenta con guantera,&nbsp;</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">indicador de marcha engranada, regulación de maneta de freno\r\nfaros led,&nbsp;</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">pantalla\r\nLCD de instrumentos,&nbsp;</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">ABS&nbsp;de&nbsp;dos\r\ncanales.</span></p>','uploads/products/23_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(23,24,'<p style=\"language:es-PY;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Es</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> la indicada para los</span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">\r\namantes del estilo Old-school, y en especial,</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">\r\na la</span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">\r\nvanguardia de la tecnología y las sensaciones de&nbsp; mucho HP y Torque, tanto en&nbsp;</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">distancias cortas y medias.</span></p>','uploads/product_descriptions/23.jpg','2019-04-29 17:09:14','2019-09-17 17:51:43'),(24,25,'<p style=\"language:es;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">&nbsp; Se\r\ndestaca por el peso. Es una moto indicada para aquellos que quieran disfrutar el momento, iniciando con una cilindra baja, con un </span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">tanque\r\nde combustible de 7 litros y motor económico de cuatro tiempos, para un rango extendido; con un&nbsp;</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">enfriado\r\npor aire, produce la potencia suave y fácil de usar, que prefieren los motociclistas recreativos.</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">&nbsp;El carburador de 24 mm ofrece una excelente respuesta del\r\nacelerador.</span></p><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"><br></span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"><br></span>',NULL,'2019-04-29 17:09:14','2019-04-29 17:09:14'),(25,26,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Perfecta para motociclistas con un perfil Off-road y aventurero. La CRF250RX</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">&nbsp;obtiene muy buena respuesta frente a cualquier obstáculo, gracias a su potencia y\r\npeso.</span></p>','uploads/products/26_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(26,27,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; La\r\nnueva CRF450R se caracteriza por un rediseño completo de las ruedas, liderado\r\npor HRC, así como por la incorporación de un arranque eléctrico de serie. HRC\r\nha proporcionado mayor potencia y par, ha añadido control de lanzamiento y un\r\nnuevo chasis. C</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">reada\r\npara entusiastas del off road con una potencia de 450cc, con entradas perfectas\r\nen curvas y saltos.</span></p>','uploads/product_descriptions/26.jpg','2019-04-29 17:09:14','2019-09-17 17:49:23'),(27,28,'<p><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"><span style=\"font-size: 11pt; text-indent: 0in;\">&nbsp; Para\r\npilotos que buscan confianza, este motor sigue el diseño del motor Unicam en el\r\nuso de dos cámaras de aceite separadas, una para el motor y otra para la caja\r\nde cambios.</span></span></p><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"><span style=\"font-size: 11pt; text-indent: 0in;\"><br></span></span><p><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"><span style=\"font-size: 11pt; text-indent: 0in;\">&nbsp; &nbsp;Este diseño es fundamental para reducir el peso y sea notablemente\r\nmás fácil de manejar que una carrera de dos tiempos,&nbsp;</span>con muñones principales carburados\r\npara una durabilidad óptima en operaciones de altas rpm sostenidas.&nbsp;</span></p>','uploads/products/28_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(28,29,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">&nbsp; Ideal\r\npara usuarios que buscan un diseño deportivo económico para la movilidad diaria,\r\nde fácil manejo, con un motor bajo en vibraciones.&nbsp;</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">Será\r\ntu transporte que te hará la vida mucho más cómoda.</span></p>','uploads/products/29_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(29,30,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size:11.0pt;font-family:Calibri;mso-ascii-font-family:\r\nCalibri;mso-fareast-font-family:+mn-ea;mso-bidi-font-family:+mn-cs;mso-ascii-theme-font:\r\nminor-latin;mso-fareast-theme-font:minor-fareast;mso-bidi-theme-font:minor-bidi;\r\ncolor:black;mso-color-index:13;language:es;mso-style-textfill-type:solid;\r\nmso-style-textfill-fill-themecolor:dark1;mso-style-textfill-fill-color:black;\r\nmso-style-textfill-fill-alpha:100.0%\">&nbsp; &nbsp;La moto más solicitada por el mercado económico y con mayor simplicidad de manejo, ya que cuenta con\r\narranque eléctrico. E</span><span style=\"color: rgb(34, 34, 34); font-family: sans-serif;\">s una&nbsp;</span><a href=\"https://es.wikipedia.org/wiki/Motocicleta\" title=\"Motocicleta\" style=\"color: rgb(11, 0, 128); background: none rgb(255, 255, 255); font-family: sans-serif;\">m</a>otocicleta<span style=\"color: rgb(34, 34, 34); font-family: sans-serif;\">&nbsp;de baja cilindrada desarrollada para uso diario.</span></p>','uploads/products/30_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(30,31,'<p style=\"language:es;line-height:normal;margin-top:0pt;margin-bottom:0pt;\r\nmargin-left:0in;margin-right:0in;text-indent:0in;mso-vertical-align-alt:auto;\r\nmso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; Una\r\nmoto de diseño deportivo, excelente desempeño y completamente avanzada para el\r\nmercado urbano</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">, con la ligereza de su acelerador de corto recorrido, otorgando una increíble capacidad de respuesta y aceleración, incluso en bajas\r\nrevoluciones con su i</span><span style=\"text-indent: 0in; color: black; font-family: Calibri; font-size: 11pt;\">nyección electrónica PGM-FI.</span></p>','uploads/products/31_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(31,32,'<p><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; &nbsp;E</span><span style=\"color: black; font-family: Calibri; font-size: 11pt; text-indent: 0in;\">s\r\nuna excelente elección para quienes buscan emoción en todo momento. El doble\r\namortiguador trasero proporciona un equilibrio perfecto entre estabilidad en\r\nrectas y respuesta en curvas; más aún en lugares realmente estrechos.&nbsp;</span></p><p><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; &nbsp;Puedes\r\nir a cualquier parte, sus</span><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\"> </span><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">puntos\r\nfuertes son la ligereza, y su fiable motor de un solo cilindro con inyección\r\nelectrónica cuyo consumo es realmente bajo.&nbsp;</span></p>','uploads/products/32_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(32,33,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp; Incluso\r\nun motociclista poco avezado pronto aprenderá a aprovecharse de una geometría\r\nmuy capaz, basada en ejes cortos, un manubrio ancho y elevado que permite una\r\nentrada fácil y un paso dinámico.</span></p>','uploads/products/33_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(33,34,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">Diseñada\r\npara&nbsp;jóvenes&nbsp;y personas que gustan de expresar su personalidad, la\r\nNavi es perfecta para transporte urbano o una salida con los amigos. Su\r\ndesempeño a un&nbsp;bajo costo de combustible, fácil maniobrabilidad y opciones\r\npersonalizadas, hacen que sea un producto&nbsp;accesible&nbsp;para todos.</span></p>','uploads/products/34_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(34,35,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black;\">&nbsp;Fácil\r\nde conducir y práctica, gracias a las proporciones de moto grande de algunos de\r\nsus componentes. Una moto totalmente nueva para disfrutar, diseñada para\r\njóvenes motoristas y con un motor de baja fricción. Posee una caja de\r\ncambios de cuatro velocidades y un carácter y estilo únicos.&nbsp;&nbsp;</span></p>','uploads/products/35_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(35,36,'<p style=\"language:es;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in\"><span style=\"font-size: 11pt; font-family: Calibri; color: black; vertical-align: baseline;\">La\r\nauténtica Maxi trail con la que puedes llegar a donde desees; hereda el nombre\r\ny espíritu de la leyenda &nbsp;del rally Paris Dakar de los 80´s, ahora con\r\nmejoras en la tecnología y la electrónica. 1.000 cc.&nbsp; 95 HP.&nbsp;&nbsp;\r\nControl de Tracción y ABS.&nbsp;</span></p>','uploads/products/36_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(36,37,'<p>La CRF puede ofrecerle muchos años de\r\nplacer, la CRF250X es impulsado por un motor de cuatro tiempos modificado para una conducción óptima fuera de la carretera.&nbsp;</p>','uploads/products/37_description_1.jpg','2019-04-29 17:09:14','2019-04-29 17:09:14'),(37,38,'<p style=\"color: rgb(64, 64, 64); font-family: \" roboto=\"\" condensed\",=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\">El aumento del desplazamiento, la mayor potencia y la mejor estabilidad, mejoran la naturaleza inspiradora de la línea recreativa CRF. Además de eso, la CRF250F trae un nuevo motor de cuatro válvulas de 250 cc con inyección electrónica de combustible Keihin para aumentar la potencia.</p><p style=\"color: rgb(64, 64, 64); font-family: \" roboto=\"\" condensed\",=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\">También, trae más torque y una entrega de potencia lineal, que da como resultado que los nuevos pilotos y los todoterreno avanzados pueden utilizar el torque fuerte en las secciones técnicas. Del mismo modo, la potencia suave de gama baja se integra perfectamente en un rango medio y superior más fuerte. También, la centralización masiva de la línea de rendimiento CRF se traslada a este modelo, el silenciador colocado más cerca del centro de masa.</p>','uploads/product_descriptions/37.jpg','2019-07-23 01:50:40','2019-09-17 00:04:04');
